[Penthouse.] Jessica Lynn, Laura Lee (The Painting)



Jessica is stuck at the museum doing homework for her art class when she`d much rather be out with her friends. It`s almost time for the museum to close and what Jessica doesn`t know is that the particular painting she`s resting by has magical qualities. Once the doors close down, the painting comes to life. And the woman in the photo will be horny as hell.



